import HomeScreen from './screens/HomeScreen.jsx';

const App = () => {
  return (
    <>
   <Header/>
    <main className='py-3'>
      <Container>
      <Outlet/>
      </Container>
    </main>
   <Footer/>
    </>
  )
}

export default App
